import React, {Component} from 'react'
import "./Layout.css"
class Layout extends Component {
    render (){
        return(
            <div className="Layout">
             <main>
             {this.props.children}
                <h1>Hello</h1>
             </main>
            </div>
        )
    }
}
export default Layout;
